                values: new object[,]
                {
                    { 1, "Події розгортаються у найближчому майбутньому. Сполученими штатами котиться нищівна та всеохоплююча громадянська війна. Почалося із бажання кількох південних штатів відділитися і тепер уся країна охоплена бойовими діями. Група журналістів, серед яких відома репортерка (Кірстен Данст), яка і раніше часто знімала збройні конфлікти, рухаються у напрямку Вашингтона. Стає очевидним, що керівництво країни перетворилося на диктатуру, а повстанські угрупування повсюдно чинять воєнні злочини.", (ushort)108, new DateTime(2024, 6, 17, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1000), (ushort)2024, "/movies/sw-vend.jpg", new DateTime(2024, 5, 17, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(989), "Повстання Штатів", "https://www.youtube.com/embed/my8iHV3dpNI?si=88h7TyNtTLoGIupq" },
                    { 2, "Джоді Морено (Емілі Блант) знімає свій перший фільм у якості режисера. Вона дуже старається та хвилюється. Добре, що на знімальному майданчику завжди є кому її підбадьорити. Кольт (Раян Ґослінґ) – каскадер. Колись вони зустрічалися з Джоді, а нині просто працюють разом та підтримують одне одного. Кольт дублює актора, який грає головну роль. Якось цей актор безслідно зникає. Ніхто не може знайти його, а це означає, що Джоді не зможе дознімати свій дебютний проект і це зруйнує її кар’єру. Кольт дуже не хоче, щоб так сталося, тож погоджується стати на деякий час детективом та розшукати актора, який невідомо куди подівся.", (ushort)126, new DateTime(2024, 6, 2, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1007), (ushort)2024, "/movies/fall_guy-vend.jpg", new DateTime(2024, 4, 28, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1006), "Каскадер", "https://www.youtube.com/embed/Xmi7ZsHL6Jg?si=v2CGyMa6CcT2KUUY" },
                    { 3, "Минуло кілька поколінь з часів правління Цезаря. Молодий шимпанзе Ноа (Овен Тіґ) уважно слухає усе, що розповідають йому про минуле і про те, як відбувався розвиток тих чи інших технологій. Він починає помічати дедалі більше невідповідностей. Аби пересвідчитись чи правильні його здогадки, він бере з собою людську дівчину на ім’я Мей (Фрея Алан). Люди давно здичавіли, тож не варто очікувати від неї багато. Разом Ноа та Мей вирушають у виснажливу подорож, результати якої визначать подальший розвиток як мавп, так і людей.\r\n\r\nФантастичний бойовик «Королівство планети мавп» є прямим продовженням фільму «Війна за планету мавп», що вийшов у 2017 році та четвертим фільмом перезапуску франшизи «Планета мавп». Про ідею цього фільму говорили ще у 2016 році. У 2019 році компанія Walt Disney оголосила, що у розробці знаходяться нові фільми та їх події розгортатимуться у тому ж всесвіті, що й фільм «Повстання планети мавп» 2011 року . Передбачається, що на екрани вийде ще щонайменше 2 фільми.", (ushort)145, new DateTime(2024, 6, 7, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1013), (ushort)2024, "/movies/kotpota_vend.jpg", new DateTime(2024, 5, 11, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1012), "Королівство планети мавп", "https://www.youtube.com/embed/Ed-rbhWhzTU?si=mIuERJ2K7Q-exaYq" },
                    { 4, "Дівчинка на ім’я Бі (Кейлі Флемінг) раптом починає бачити уявних друзів. Звісно, деякі діти фантазують про таку компанію. Однак Бі нічого не вигадувала. Дівчинка бачить безліч дивних персонажів, яких вигадав хтось інший. Виявляється, що такою самою силою наділений і її сусід (Раян Рейнольдс). Тепер вони удвох даватимуть раду чималій когорті чудернацьких створінь. Справа в тім, що діти, які вигадали цих персонажів, давно виросли та забули про своїх кращих друзів. Було б добре їм знову зустрітися.\r\n\r\nФентезійна комедійна драма «Уявні Друзі (УД)» – це дітище Джона Красінскі, відомого передовсім за роллю у серіалі «Офіс». Він має досвід створення повнометражного кіно («Тихе місце»), однак цього разу вдався до нового для себе жанру, сам займався сценарієм та режисурою. Проект для сімейного перегляду задумав у співпраці з батьком чотирьох дітей Раяном Рейнольдсом. Вони удвох продюсували фільм та знімалися у ньому.", (ushort)104, new DateTime(2024, 6, 17, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1018), (ushort)2024, "/movies/if-vend2.jpg", new DateTime(2024, 5, 17, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1017), "Уявні Друзі", "https://www.youtube.com/embed/EFrEPzxmQjM?si=d-0RtIH00F7L0dg6" },
                    { 5, "У 2001 році молоді київські розробники на чолі з Сергієм Григоровичем вирішують зробити найскладнішу гру в світі з реалістичною графікою, відкритим світом і нетиповим сюжетом довкола Чорнобильської зони.\r\n\r\nЗ початку промокампанії S.T.A.L.K.E.R. чекали сотні тисяч людей по всьому світу, але розробники стали заручниками своїх амбіцій. Вони безкінечно покращували гру та з року в рік переносили дату виходу. Але в один момент американському видавцю увірвався терпець.\r\n\r\nЦе історія про індустрію відеоігор, любов до своєї роботи та проєкт, який перейшов межі екранів і став попкультурним феноменом.\r\n\r\n«ЕПІЗОДИ» — це історії незалежної України. Вони здаються такими різними, але водночас дуже схожі: наївні, сумні, амбітні. Це визначні події, на яких виросли цілі покоління. Розповіді від перших осіб із використанням унікальних архівних матеріалів.", (ushort)77, new DateTime(2024, 6, 9, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1024), (ushort)2024, "/movies/stalker-vend2.jpg", new DateTime(2024, 5, 14, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1023), "ЕПІЗОДИ: Тінь Чорнобиля", "https://www.youtube.com/embed/wkSS8XmDSGc?si=l-lyfNL7pmUzB-ia" },
                    { 6, "Восени 2014 року хірург Сергій (Роман Луцький), який останнім часом оперує багато поранених на російсько-українській війні, вирішує стати військовим лікарем. Майже одразу Сергій потрапляє в полон. Він пережив нелюдські тортури та приниження. Від смерті його врятувало тільки те, що ФСБшникам, які катували полонених, потрібно було радитись з лікарем. Повернувшись додому після обміну Сергій намагається налагодити мирне життя та відновити спілкування з колишньою дружиною та донькою Поліною (Ніка Мислицька).\r\n\r\nВоєнна драма «Відблиск», знята режисером та сценаристом Валентином Васяновичем, є першою українською стрічкою, що брала участь у основній програмі Венеціанського кінофестивалю. Сценарій був готовий у 2019 році, а основні зйомки проходили з літа 2020 року по січень 2021 у Києві та його околицях Серед тих, хто знімався у фільмі – справжній хірург Олександр Данилюк, який зробив в польових умовах понад 70 операцій та журналіст Станіслав Асєєв, який два роки пробув у російському полоні.", (ushort)126, new DateTime(2024, 6, 9, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1029), (ushort)2021, "/movies/reflection-vend.jpg", new DateTime(2024, 5, 14, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1028), "Відблиск", "https://www.youtube.com/embed/voDDciroV1A?si=6tx7HhMJM0hbKrMb" },
                    { 7, "Беккет (Мо Гілліган) був маленьким беззахисним кошеням, коли мало не загинув. Його врятувала Роуз (Сімон Ешлі) та забрала жити до себе. Відтоді Беккет став геть іншим – сміливішим, впевненішим у собі та, звісно, огряднішим. Незмінними лишилися лише його впізнавані різнокольорові очі. Кіт був впевнений у тому, що вся увага та любов Роуз налижить лише йому. Тож коли дівчина почала дбати не лише про нього, Беккет втнув дещо необачне. Як результат він витратив відведені йому 9 життів. Аби повернутися до улюбленої хазяйки він знову потрапить на землю, але це буде зовсім не те життя, до якого він звик.\r\n\r\nКомедійний сімейний мультфільм «10 життя» створено спільно Великою Британією та Канадою на монреальській студії L'Atelier Animation. Режисер та сценарист проекту – Крістофер Дженкінс, кар’єра якого починалася у Walt Disney Pictures. У якості аніматора ефектів він працював над багатьма мультфільмами студії, серед яких «Русалонька» та «Король Лев».", (ushort)88, new DateTime(2024, 6, 13, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1034), (ushort)2024, "/movies/10Lives-vend.jpg", new DateTime(2024, 5, 8, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1033), "10 життя", "https://www.youtube.com/embed/wIQE7rBdr1c?si=XDXbqcIQFyXus8Nk" },
                    { 8, "1927 року у Харкові за наказом Сталіна збудовано особливий будинок. Тут оселилися кращі українські митці – поети, письменники, художники та режисери. Сама лише можливість жити тут вже була для тогочасних творців визнанням. Якось у будинку з’являється новенький. Він працює коректором преси та понад усе мріє влитися в когорту провідних письменників. Аби оселитися тут йому дійсно знадобився талант – талант підслуховувати та переповідати все почуте агенту НКВС.\r\n\r\nІсторична драма «Будинок «Слово». Нескінчений роман» знята Тарасом Томенком за сценарієм, написаним ним спільно з Любов’ю Якимчук. У 2017 році він зняв документальний фільм «Будинок «Слово»», робота над яким надихнула на подальше дослідження епохи та персоналій. Проект художнього фільму став одним з переможців конкурсу від Держкіно та отримав державне фінансування, що покрило половину витрат на виробництво.", (ushort)120, new DateTime(2024, 6, 7, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1039), (ushort)2024, "/movies/BSNR-vend.jpg", new DateTime(2024, 5, 8, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1038), "Будинок «Слово». Нескінчений роман", "https://www.youtube.com/embed/EdwK7LCzw1k?si=7Ms_0kyh7mJKAgLg" },
                    { 9, "Компанія друзів збирається разом. Замість звичних посиденьок вони влаштовують ворожіння на картах Таро, які одна з дівчат випадково знайшла на захаращеному горищі. Головна помилка, якої вони припустились – порушення незмінного правила про те, що не можна брати до рук чужі карти. Вечір довгий, тож поворожити встигли усім присутнім. Такі їхні дії вивільнили древні зли сили, які не прощають тим, хто порушив їхній спокій. Колода карт була проклятою і тепер смерть чекає на кожного, хто насмілився дізнатися свою подальшу долю з їх допомогою. Для кожного, кому ворожили, починаються перегони зі лихою силою, яка не знає ані втоми, ані жалю.\r\n\r\nФільм жахів «Таро» зняли Спенсер Коен та Анна Ройс. Вони спільно написали сценарій, використавши за основу книгу «Жахи», написану Ніколасом Адамсом у 1992 році. Режисурою зайнялися також удвох і для обох цей фільм став дебютним на великому екрані, тоді як у сценарній справі досвід мали обоє.", (ushort)92, new DateTime(2024, 6, 11, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1044), (ushort)2024, "/movies/TAROT-vend.jpg", new DateTime(2024, 5, 17, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1043), "Таро", "https://www.youtube.com/embed/j3wUuh8GJto?si=OrZerBeec68n6Yrv" },
                    { 10, "Чемпіон Турніру Великого шлему Арт Дональдсон (Майк Файст) зазнає серію поразок. Колись він був посереднім гравцем. Чемпіона з нього зробила його дружина Таші (Зендея). Тенісистка у минулому, нині вона присвятила себе тренуванню чоловіка. Аби він повернув собі жагу до перемог, Таші записує його до участі у турнірі Challenger. Зазвичай у ньому беруть участь початківці або гравці другого дивізіону. Однак для ситуації, що склалася у Арта, це буде доречно. Незадовго до змагань чоловік дізнається, що у турнірній сітці його суперником буде Патрік Цвейг (Джош О'Коннор), колишній коханець його дружини та його кращий друг.\r\n\r\nСпортивну мелодраму «Суперники» зняв режисер Лука Ґуаданьїно, чотириразовий володар премій Венеціанського кінофестивалю. Для зйомок у фільмі Зендая впродовж трьох місяців займалася з професійним тенісним тренером. Зйомки розпочалися у травні 2022 року у Бостоні. Цьому передували кастинги, під час яких серед місцевих жителів шукали акторів масовки.", (ushort)132, new DateTime(2024, 6, 12, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1049), (ushort)2024, "/movies/CHLNGRS-vend2.jpg", new DateTime(2024, 5, 3, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1048), "Суперники", "https://www.youtube.com/embed/ckcxzebS5hk?si=ERSDSJqtNnVuBH1n" },
                    { 11, "Дівчина з бідної родини виходить заміж та оселяється у віддаленому будинку її обранця посеред густого лісу. Світ чоловіка для неї геть чужий, а мрії про дитину стають нездійсненним тягарем. З кожним днем важкої рутини та марних сподівань, вона все більше закривається в собі. Допоки не опиняється на темному шляху, що веде до злих думок. Можливо, не лише думок…", (ushort)121, new DateTime(2024, 5, 19, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1055), (ushort)2024, "/movies/vend.jpg", new DateTime(2024, 5, 19, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1054), "Лазня диявола (в рамках фестивалю)", "https://www.youtube.com/embed/vtmo7fplVWo?si=DKOyUUar-Z5cFUwj" },
                    { 12, "Війна, що триває з 2014 року, вплинула на життя багатьох українців. Якось посеред ночі на телефон батька (В'ячеслав Довженко) замість сина з його номера зателефонував невідомий. Так стало відомо, що хлопець, який виконував бойове завдання, потрапив у полон. Аби визволити його батько повинен сам поїхати на лінію розмежування та привезти зазначену суму. Однак на обмін замість сина привезли іншого хлопця. У таких самих або подібних обставинах не лише ці син і батько. З кожним днем число родин, чиє життя докорінно змінила війна, щоразу більшає. Тож чи можна домовитися з ворогом, для якого не існує ніяких правил та етичних норм?\r\n\r\nВоєнна драма «Обмін» створена за підтримки Державного агентства з питань кіно. Режисер проекту Володимир Харченко-Куликовський має великий досвід у виробництві серіалів для українського телебачення. Зйомки велися на території Київської області, у Броварському районі, який на початку повномасштабного вторгнення був частково окупований.", (ushort)90, new DateTime(2024, 5, 25, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1060), (ushort)2024, "/movies/obmin-vend-18.jpg", new DateTime(2024, 5, 16, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1059), "Обмін", "https://www.youtube.com/embed/obiN4-XK7_4?si=Tv8aIjC6LNcY96Nt" },
                    { 13, "Зимова Олімпіада 1976 року. Гірськолижнику Францу Кламмеру тільки 22 роки, а його вже називають майбутньою зіркою. За плечима юнака чимало перемог, тож преса й публіка сподіваються на його нові здобутки. Але тиск очікувань тисяч австрійців — не єдиний виклик у цьому змаганні. Незадовго до перегонів спонсор вирішує змінити звичні форму та спорядження, погодні умови чимдалі гіршають, а траса здається неприступною. Єдине, що не дає герою зламатися — кохання його життя.", (ushort)100, new DateTime(2024, 5, 19, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1066), (ushort)2024, "/movies/vend1.jpg", new DateTime(2024, 5, 19, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1064), "Виходячи за межі (в рамках фестивалю)", "https://www.youtube.com/embed/ecp1xSqaA5c?si=OvYH_CGwjXdqGGNw" },
                    { 14, "1988 року Ніколаса Вінтона (Ентоні Гопкінс) запрошують на телевізійне шоу. Ведуча розповідає про унікальну місію порятунку сотень дітей. Напередодні Другої світової війни з Праги до Великої Британії перевезли спеціальними поїздами дітей, переважно єврейських. Усі вони змушені були шукати новий дім з остраху перед діями нацистів. Координував операцію 29-річний Ніколас Вінтон (Джонні Флінн). Кожному перевезеному потрібно було знайти нове місце проживання та чималу суму грошей. Близько 50 років деталі перевезення не оприлюднювалися і ось, нарешті, настав час оцінити масштаби зробленого.\r\n\r\nБіографічна драма «Одне життя» заснована на книзі Барбари Вінтон, яку жінка написала про свого батька, Ніколаса Вінтона. На початку 1939 року він організував маршрут, яким було перевезено 669 дітей. На зйомках фільму були задіяні нащадки врятованих дітей. Барбара Вінтон особисто попросила Ентоні Хопкінса виконати роль її батька. Знімали фільм у Празі та Лондоні наприкінці 2022 року.", (ushort)108, new DateTime(2024, 5, 30, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1071), (ushort)2023, "/movies/ol-vend3.jpg", new DateTime(2024, 5, 24, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1070), "Одне життя", "https://www.youtube.com/embed/R0qZJggKri0?si=Iu5Rg7eDTJeoF6-q" },
                    { 15, "Закохана пара Майа (Меделін Петш) та Райан (Фрой Гутьєррез) на честь своєї п’ятої річниці подорожують крізь усю країну до Тихоокеанського узбережжя. Дорогою через штат Орегон в них ламається машина. Заночувати доведеться у єдиному доступному місці – старенькому будиночку десь у хащах на околиці маленького непривітного міста. Що люди, що краєвиди не викликали жодної симпатії, але Майа звикла знаходити хороше у всьому, що їх оточує. З настанням ночі всього оптимізму світу не вистачить, аби розгледіти бодай щось хороше у тому, що почало відбуватись. До хатини вдерлося троє незнайомців у масках.\r\n\r\nЖахи «Незнайомці: Частина перша» є продовженням франшизи «Незнайомці», перший фільм якої вийшов на екрани у 2008 році. Продовження презентували 2018 року. Новий фільм стане першим у трилогії, яку знімали одночасно. Передбачається, що сюжет розкриє історію появи людей у масках та покаже що стається з їхніми жертвами. Знімали у столиці Словаччини Братиславі наприкінці 2022 року.", (ushort)91, new DateTime(2024, 6, 7, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1143), (ushort)2024, "/movies/STRNGR1-vend.jpg", new DateTime(2024, 5, 31, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1142), "Незнайомці: Частина перша", "https://www.youtube.com/embed/dUe_Ac4V-R4?si=fxBrFFENDZKs2iPA" },
                    { 16, "Життя милої дівчинки Зузі (Ліліана Зайберт) докорінно змінюється, коли тато (Матеуш Дамецький) приводить з залізничної станції, де він працює, собаку. Песику дали ім’я Лампо та оточили турботою. Цей пес – справжній мандрівник і довго сидіти на місці він не любить. Куди б він не їхав, він зачаровує пасажирів та стає улюбленцем. Само тому мережею шириться безліч світлин з Лампо. Нажаль, є й ті, кому слава милого песика не до вподоби. Заздрісники хочуть назавжди позбавити Лампо дому та можливості подорожувати, а дівчинку Зузі розлучити з кращим другом.\r\n\r\nСімейний фільм «Лампо: Вірний пес» знято польською режисеркою Магдалиною Ніц. У основі сюжету – популярна у Польщі дитяча книга, яка входить до місцевої шкільної програми. Історію написав у 1967 році Роман Писарський, польський письменник, який народився у Івано-Франківську. Пес, про якого йдеться у дитячій історії, справді жив у 1950-х роках та без супроводу людей подорожував Європою на поїздах.", (ushort)120, new DateTime(2024, 6, 10, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1164), (ushort)2023, "/movies/lampo-vend.jpg", new DateTime(2024, 6, 3, 14, 1, 16, 508, DateTimeKind.Utc).AddTicks(1163), "Лампо: Вірний пес", "https://www.youtube.com/embed/iynOv10VcNU?si=YG_3DrY0TLYM4_Qv" }
                });

